int x, y;
for (y = -10; y <= 2; ++y) {
  draw((-0.6,y/3)--(2.4,y/3),gray(0.7));
}
for (x = -1; x <= 7; ++x) {
  draw((x/3,-3.5)--(x/3,1),gray(0.7));
}

draw(shift((1,-2))*xscale(2/3)*Circle((0,0),1));
draw((0,-3.5)--(0,1),EndArrow);
draw((-.6,0)--(2.4,0),EndArrow);
//for (real i=-1/3; i<=2; i += 1/3)
	//draw((i,0.1)--(i,-0.1));
//for (real i=-3-1/3; i<.9; i += 1/3)
	//draw((-0.1,i)--(0.1,i));
