Type: Geometry
Level: Level 4
Problem: A cube of edge length $s > 0$ has the property that its surface area is equal to the sum of its volume and five times its edge length. Compute the sum of all possible values of $s$.

[asy]

size(5cm,5cm);

pair A,B,C,D,E,F,G,H;

A=(0,0);
B=(1,0);
C=(1,1);
D=(0,1);
E=(0.3,1.5);
F=C+(E-D);
G=B+(E-D);
H=A+(E-D);

